        return new Source("{% extends 'base.html.twig' %}

{% block title %}New Program{% endblock %}

{% block body %}
<div class=\"info-container\">
    <div class=\"info-body\">
    <table class=\"table table-light text-center\">
        <thead class=\"info-thead\">
            <tr>
                <th>New Program</th>
            </tr>
        </thead>
        <tbody>
            <tr>
                <td>
                    <div class=\"new-card\">
                        <div class=\"new-card--entity\">
                        {{ form_start(form) }}
                            {{ form_label(form.title) }}
                            {{ form_widget(form.title) }}

                            {{ form_label(form.description) }}
                            {{ form_widget(form.description) }}

                            {{ form_label(form.time) }}
                            {{ form_widget(form.time) }}
                        </div>
                     <div class=\"image-card d-flex justify-content-around align-items-center\">
                        {{ form_label(form.img_path) }}
                        {{ form_widget(form.img_path) }}
                    <div class=\"hidden-content\">
                        {{ form_label(form.set_image_default) }}
                        {{ form_widget(form.set_image_default) }}
                    </div>
                    </div>
                    </div>  
                        <div class=\"new-card check-box--flex\">
                            {{ form_label(form.exercises) }}
                            {{ form_widget(form.exercises) }}
                        </div>
                    </div>
                    <button class=\"btn btn-success btn-block\">{{ button_label|default('Create') }}</button>
                    {{ form_end(form) }}
                </td>
            </tr>
        </tbody>
    </table>
        <div class=\"back-list-button\">
            <a href=\"{{ path('admin_program_index') }}\" button type=\"button\" class=\"btn btn-primary btn-block\">Back to list</a>
        </div>
    </div>
</div>
{% endblock %}", "admin/program/new.html.twig", "/Users/richard/Documents/WEB/APOTHEOSE/ablock V2./templates/admin/program/new.html.twig");
